import React, { useState, useEffect } from 'react';
import './EmployeeAssignment.css';

const EmployeeAssignment = ({ projectId, onEmployeesAssigned }) => {
    const [availableEmployees, setAvailableEmployees] = useState([]);
    const [assignedEmployees, setAssignedEmployees] = useState([]);
    const [selectedEmployeeId, setSelectedEmployeeId] = useState('');
    const [roleInProject, setRoleInProject] = useState('');
    const [loading, setLoading] = useState(false);

    useEffect(() => {
        fetchAvailableEmployees();
        fetchAssignedEmployees();
    }, [projectId]);

    const fetchAvailableEmployees = async () => {
        try {
            const response = await fetch('/api/employees', {
                credentials: 'include'
            });
            if (response.ok) {
                const data = await response.json();
                setAvailableEmployees(data);
            }
        } catch (error) {
            console.error('Error fetching employees:', error);
        }
    };

    const fetchAssignedEmployees = async () => {
        try {
            const response = await fetch(`/api/projects/${projectId}/employees`, {
                credentials: 'include'
            });
            if (response.ok) {
                const data = await response.json();
                setAssignedEmployees(data);
                onEmployeesAssigned(data);
            }
        } catch (error) {
            console.error('Error fetching assigned employees:', error);
        }
    };

    const handleAssignEmployee = async () => {
        if (!selectedEmployeeId) {
            alert('Please select an employee');
            return;
        }

        setLoading(true);
        try {
            const url = `/api/projects/${projectId}/employees/${selectedEmployeeId}${roleInProject ? `?roleInProject=${encodeURIComponent(roleInProject)}` : ''}`;
            const response = await fetch(url, {
                method: 'POST',
                credentials: 'include'
            });

            if (response.ok) {
                setSelectedEmployeeId('');
                setRoleInProject('');
                fetchAssignedEmployees();
                alert('Employee assigned successfully');
            } else {
                alert('Failed to assign employee');
            }
        } catch (error) {
            console.error('Error assigning employee:', error);
            alert('Error assigning employee');
        } finally {
            setLoading(false);
        }
    };

    const handleRemoveEmployee = async (employeeId) => {
        if (window.confirm('Are you sure you want to remove this employee from the project?')) {
            try {
                const response = await fetch(`/api/projects/${projectId}/employees/${employeeId}`, {
                    method: 'DELETE',
                    credentials: 'include'
                });

                if (response.ok) {
                    fetchAssignedEmployees();
                    alert('Employee removed successfully');
                } else {
                    alert('Failed to remove employee');
                }
            } catch (error) {
                console.error('Error removing employee:', error);
                alert('Error removing employee');
            }
        }
    };

    const getUnassignedEmployees = () => {
        const assignedIds = assignedEmployees.map(pe => pe.employee.id);
        return availableEmployees.filter(emp => !assignedIds.includes(emp.id));
    };

    const handleContinue = () => {
        if (assignedEmployees.length === 0) {
            alert('Please assign at least one employee to continue');
            return;
        }
        onEmployeesAssigned(assignedEmployees);
    };

    return (
        <div className="employee-assignment">
            <div className="assignment-form">
                <h4>Assign Existing Employees</h4>
                <div className="form-row">
                    <div className="form-group">
                        <label>Select Employee</label>
                        <select
                            value={selectedEmployeeId}
                            onChange={(e) => setSelectedEmployeeId(e.target.value)}
                            disabled={loading}
                        >
                            <option value="">Choose an employee</option>
                            {getUnassignedEmployees().map(emp => (
                                <option key={emp.id} value={emp.id}>
                                    {emp.name} ({emp.empId})
                                </option>
                            ))}
                        </select>
                    </div>
                    <div className="form-group">
                        <label>Role in Project (Optional)</label>
                        <input
                            type="text"
                            value={roleInProject}
                            onChange={(e) => setRoleInProject(e.target.value)}
                            placeholder="e.g., Developer, Tester, Manager"
                            disabled={loading}
                        />
                    </div>
                    <div className="form-group">
                        <button
                            onClick={handleAssignEmployee}
                            disabled={loading || !selectedEmployeeId}
                            className="btn-assign"
                        >
                            {loading ? 'Assigning...' : 'Assign Employee'}
                        </button>
                    </div>
                </div>
            </div>

            <div className="assigned-employees">
                <h4>Assigned Employees ({assignedEmployees.length})</h4>
                {assignedEmployees.length === 0 ? (
                    <p className="no-employees">No employees assigned yet</p>
                ) : (
                    <div className="employee-list">
                        {assignedEmployees.map(pe => (
                            <div key={pe.id} className="employee-card">
                                <div className="employee-info">
                                    <strong>{pe.employee.name}</strong>
                                    <span className="emp-id">ID: {pe.employee.empId}</span>
                                    {pe.roleInProject && (
                                        <span className="role">Role: {pe.roleInProject}</span>
                                    )}
                                    <span className="assigned-date">
                                        Assigned: {new Date(pe.assignedDate).toLocaleDateString()}
                                    </span>
                                </div>
                                <button
                                    onClick={() => handleRemoveEmployee(pe.employee.id)}
                                    className="btn-remove"
                                >
                                    Remove
                                </button>
                            </div>
                        ))}
                    </div>
                )}
            </div>

            <div className="assignment-actions">
                <button
                    onClick={handleContinue}
                    disabled={assignedEmployees.length === 0}
                    className="btn-continue"
                >
                    Continue to Timesheet
                </button>
            </div>
        </div>
    );
};

export default EmployeeAssignment;
